import React from "react"
import { ReactDOM } from "react"
import { render } from "react-dom"

const reactContentRoot = document.getElementById("root")

const App = () => {
  const myItem = "mike"

  return (
    <ul>
      <li>item1</li>
      <li>item255</li>
      <li>{myItem.toUpperCase()}</li>
    </ul>
  )
}

Rearender(<App />, reactContentRoot)
